import { StyleSheet, SafeAreaView } from 'react-native';
import SignInScreen from './client/views/SignInScreen';

export default function App() {
  return (
    <SafeAreaView style={styles.container}>
      <SignInScreen/>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
  },
});
